import queryString from "querystring";
import { useEffect } from "react";
import { useHistory } from "react-router";
import { useDispatch, useSelector } from "react-redux";

import { enumExternalMethod, PATH_SIGN_UP_SOCIAL_TEL } from "@configs";
import { logout, selectAuth, setExternalLogin, setMerchantID } from "@redux";
import { merchantApi } from "@api";
import { IMerchantQRcode } from "@interfaces";

export const PageTrafficSource = () => {
    //page hook
    const dispatch = useDispatch();
    const history = useHistory();
    //redux state
    const { externalLogin } = useSelector(selectAuth);
    //page variable
    const queryParams = queryString.parse(window.location.search.substring(1));

    useEffect(() => {
        merchantConfig();
    }, []);

    const merchantConfig = async () => {
        const res = await merchantApi.getMerchantId("80091ce4-05bb-46d1-b676-9298ea3c63ee");
        const data = res.data as IMerchantQRcode;
        setMerchantID(data.merchantId);
        const merchantConfig = await merchantApi.getMerchantConfig();
    };
    return <></>;
};
